style.css:
@-moz-document url(https://chat.openai.com/) {
* {
    letter-spacing: 1px !important;
    text-decoration: none !important;
    transition: none !important;
    font-family: 'Franklin Gothic UI', 'Montserrat', 'Noto Sans';
}

/* Headings */
h1,
h2,
h3,
h4,
h5,
h6 {
    color: #F0A060;
}

/* Text */
p,
li,
label,
time,
selector {
    color: #F0A060;
    font-size: 1.25rem;
    line-height: 3rem !important;
    margin: 13px 6px;
    padding: 0.2rem;
    text-transform: capitalize;
}

/* Links */
a[href],
a[href]:visited {
    color: #f0a060 !important;
    text-shadow: 1px 1px #000;
}

a[href]:hover {
    color: #F0A060;
}

/* Code */
code,
.hljs-comment {
    color: #F0A060;
}

/* Lists */
.markdown ol li,
.markdown ol li>p,
.markdown ol ol,
.markdown ol ul,
.markdown ul li,
.markdown ul li>p,
.markdown ul ol,
.markdown ul ul {
    margin: 3px 1px !important;
}

/* Forms */
input,
input[type=email],
input[type=number],
input[type=password],
input[type=search],
input[type=tel],
input[type=text],
select,
textarea {
    background-color: transparent !important;
    background-image: none !important;
    color: limegreen !important;
}

::placeholder {
    color: cyan !important;
    opacity: 1;
}

/* Buttons */
.btn-primary:hover,
.dark .btn-neutral:hover,
li.relative a:hover,
.flex.p-4.bg-gray-50.dark\:bg-white\/5.rounded-md.items-center.gap-4.min-h-\[71px\]:hover {
    color: #F0A060;
}

/* Selection */
::selection {
    background: #F0A060;
    color: #000;
}

/* Background */
body,
html {
    background: #000 !important;
}

.dark body,
.dark html {
    background-color: black !important;
}

/* Containers */
.prose {
    color: brown;
    font-size: 1.25rem !important;
}

/* Prompt */
textarea#prompt-textarea {
    background-color: transparent;
}

/* Workspace */


/* Gizmo */
.gizmo\:\[\&\:has\(textarea\:focus\)\]\:border-token-border-xheavy {
    background-color: black !important;
    display: inline-block;
    width: auto !important;
}

.gizmo\:\[\&\:has\(textarea\:focus\)\]\:border-token-border-xheavy {
    background-color: black !important;
    display: inline-block;
    width: auto !important;
}

.gizmo\:\[\&\:has\(textarea\:focus\)\]\:border-token-border-xheavy {
    background-color: black !important;
    display: inline-block;
    width: auto !important;
}

/* Sizing */
.selector {
    font-size: 2.5rem !important;
    left: -9999px !important;
    position: absolute !important;
    top: -9999px !important;
    top: 10px !important;
    margin: 1.2rem !important;
    padding: 1.2rem !important;
    max-height: none !important;
    height: auto !important;
    width: auto !important;
}

.xl\:max-w-3xl {
    max-width: none !important;
}

.lg\:w-\[calc\(100\%-115px\)\] {
    width: calc(98% - 115px);
}

.xl\:max-w-3xl,
.lg\:w-\[calc\(100\%-115px\)\],
.selector {
    max-width: none;
    width: auto;
    max-height: none;
    height: auto;
}

/* Colors */
.font-semibold {
    color: orange;
    font-family: 'Verdana';
}

li {
    color: #4fffa9 !important;
}

p {
    color: yellowgreen !important;
}

.w-full:nth-child(odd) p:nth-child(odd) {
    color: #F0AA99;
}

.w-full:nth-child(even) p:nth-child(even) {
    color: #F0AA99;
}

.bg-black,
.bg-black {
    background: #0000;
    background-color: #0000;
}

.dark .dark\:bg-gray-800\/90 {
    background-color: #000000e0 !important;
}

.dark .dark\:bg-\[\#444654\],
.dark .dark\:bg-gray-800,
.bg-gray-900 {
    background: #F0A060;
    background-color: #060505;
}

.p-4.overflow-y-auto {
    background-color: #331d00;
    font-weight: normal;
  }}
